    data: |
      SELECT DISTINCT + - col2 * col0 + col0 * cor0.col0 + - col2 * - col2 AS col1 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q11400.out
    data: |
      1191
      7347
      873
